(60603, 173322, 0, 1, '是我', '這首歌，描述一個男生跟一個女生分手後的掙扎與寂寞。\n明明就很清楚的知道從今天開始，她不再屬於自己，\n但卻因為過去約定好的總總承諾，讓自己完完全全的放不開。\n當男主角在深夜或寂寞時，總是會拿著手機在床上翻來覆去，\n內心煎熬的問著自己，明明就深愛著她，但卻無法再撥出手機裡這個號碼。\n明明就知道如何找到她，卻得克制自己內心的交戰。\n\n當男主角每次走過曾經與女主角一起走過的街道，\n亦或是想起曾經一起看過的電影，或是約定好的旅行，\n都會使他發了瘋似的大哭。\n\n有時候想著沒有她的明天，就會徬徨的無助。\n那曾經是自己最親愛的人，今後將成為永遠的陌生人。\n男主角漸漸的失落，再有一次不小心的狀況下，卻真的將電話號碼撥通。\n但還沒等到對方接起，便馬上又緊張的掛上。\n他很害怕她的聲音，更害怕她掛了自己電話。\n那種忐忑不安的心情，不停的揪住自己的心臟。\n\n「是我不夠成熟 太過脆弱 才會放不開你給我的承諾」\n這一句話道出了男主角對於這段感情的無奈及傷感，也開始懷疑自己是否是因為自己的不成熟和脆弱，才會導致自己的情緒一直無法走出來。又或者是自己太過念舊，才會無法了解「提得起，就要放的下。」或者應該這麼說，雖然了解應該要放下，當下的自己卻無法做到，因為太多回憶了，真的深愛過一個人，是無法很快的去擁抱另一個人來撫慰自己的。若真的這麼去做了，只會顯得自己急著抓著一個新的軀體來填補自己的寂寞而已，那並不是真的愛情。\n\n「是你曾經說過 你答應我 不管發生什麼事你都不會走」\n也是因為這句似海誓山盟般的諾言，才會使得男主角如此的痛楚。有時候在相愛時，可能會因為一時的衝動或是感動說出一些千山萬水的美言愛情佳句；但當這些在愛情恢復平靜之時，都會成為一方永久無法拭去的傷痕。說好的，會一直一直走下去，會一直一直愛著彼此，最後只剩下一個人獨自撐過，這對還深愛另一方的人來說，是非常殘酷的。\n\n這首歌，是當時自己的故事。把當時的心情寫成了歌，記錄這一段回不去的愛情，同時也送給我曾深愛過的妳。謝謝妳，因為妳有了這首歌的出現；謝謝妳，因為妳我更認識了自己。\n\n---\n樂尼克音樂工作室粉絲頁\nhttp://www.facebook.com/UNiQuEStudio2012/\n喜歡我們的音樂請幫我們按一個讚與轉貼給我們支持唷!!\n\nStreetVoice街聲\nhttp://tw.streetvoice.com/users/unique2012/\nyoutube\nhttps://www.youtube.com/playlist?list=PLHBQ94-oTFPKRZuBx-zvkRcqz5KLgb6ft\n', '2013-02-06 00:00:00', 2000, 0, 1, 4, '是我\n詞/曲/編曲：江長金\n演唱：3M陳永謙\n合聲：林育諄、鄧伊珊\n混音：林育諄\n\n還是我 只是有點寂寞\n電話簿找不到誰想聯絡\n不自覺的輸入你的號碼撥通\n怎麼了我 又發了瘋\n\n都是我 因為捨不得你得溫柔\n在一首首歌反覆播送\n依舊解不開被你捆綁地自由\n你卻選擇 不動於衷\n\n是我不夠成熟 太過脆弱 才會放不開你給我的承諾\n是你曾經說過 你答應我 不管發生什麼事你都不會走\n只是我還不懂 你的看透 怎能讓我一次次的墜落\n猜不透 是不是我要求太多\n\n如果 這是場夢 請讓我快點清醒別再惡夢\n然後 抓你的手 告訴你我在夢裡有多難過\n\nCopyright 2013 UNiQuE StuDiO. All Rights Reserved.\n', '', 332, '', '江長金', '江長金', '樂尼克音樂', '', '', 0, 1, 0, '2013-02-06 00:05:59', '2015-03-12 13:59:13', '0000-00-00 00:00:00'),
