(60612, 36185, 0, 0, '這世界(Demo)', '有時候會覺得世界上總有太多虛偽\r\n讓我們總分不清是非對錯\r\n有時候  想一想\r\n現今社會上的價值觀真的都是對的嗎?\r\n\r\n\r\nVocal:景豪', '2012-02-14 00:00:00', 2000, 0, 1, 7, '這世界\r\n詞/曲:李家元\r\n\r\n所謂善有善報老師教的那一套\r\n有的時候也只是嘮哩嘮叨\r\n況且大大大大部份的時候\r\n課本教的媽媽說的只是理論上理想的\r\n\r\n理想現實往往是差很多的\r\n又為何要成為這社會上期望的\r\n或許所謂道德我根本不適合\r\n掙脫了束縛的我嚮往自由\r\n\r\n到底是我不懂這世界\r\n還是這世界太過虛偽\r\n從前的規則都推翻了\r\n痛到深處我才捨得 \r\n到了最後了我才懂得\r\n\r\n所謂的這一切沒有對不對\r\n真實近在眼前\r\n就只怕你懦弱而不敢面對\r\n在這世界沒有是與非\r\n答案另一面是人心的虛偽\r\n\r\n自古來的道裡總有太多太多\r\n又為什麼我就非要跟著它走\r\n況且你又真的知道為什麼\r\n他們說的你在想的是不是一定是對的\r\n \r\n對和錯往往就只有一線之隔\r\n又該如何定義誰是好人壞人\r\n從小到大我們都被灌輸著\r\n真的假的對的錯的\r\n都全盤接收了 這世界\r\n當這世界越來越虛偽\r\n從前的規則都推翻了\r\n痛到深處我才捨得 \r\n到了最後了我才懂得\r\n\r\n這一切沒有對不對\r\n真實近在眼前\r\n就只怕你懦弱而不敢面對\r\n在這世界沒有是與非\r\n答案另一面是人心的虛偽\r\n\r\n當我看透了這無奈\r\n到底還有沒有未來\r\n到底甚麼才是好壞\r\n又為了甚麼才存在\r\n在這瘋狂渾沌的年代\r\n\r\noh~~Yeah\r\n這一切沒有對不對\r\n真實近在眼前\r\n就只怕你懦弱而不敢面對\r\n在這世界沒有是與非\r\n答案另一面是人心的虛偽', '', 236, '', '李家元', '李家元', '李家元', '', '', 0, 1, 1, '2013-02-06 05:10:16', '2013-10-07 17:23:56', '2013-04-15 19:02:05'),
