(60702, 72723, 5586, 6, ' 印尼甘美朗－水漾貝啦', '此曲為棉六＜環遊世界－為傳統樂器寫詞＞系列的詞，當時作曲人接招譜曲失敗，因不放棄再次嘗試後，終於成功！', '2013-02-01 00:00:00', 2000, 0, 1, 7, '＜印尼甘美朗＞\n詞：水漾貝啦　曲：默默＋JC\n\n沙度，嘟哇，滴嘎，嗯巴，哩嘛 （中譯 1、2、3、4、5）\n\n如繁星撒落的 ～千島之國\n飛進這國度～ 心靈 ～瞬間超脫\n\n啦啦啦啦...啦啦啦啦...\n\n眺望～日出美景 \n約莫～十六世紀情\nTanah Lot～忽逢巨浪危急（Tanah Lot 中譯：海神廟）\n慈悲和尚 ～解腰帶拋入海裡\n\n腰帶瞬間～幻化兩條海蛇\n滔天巨浪裡～鎮住浪潮襲擊\n海神廟～高高立於岩石頂 \n四水環繞～ 與陸地隔離\n\n傳說～毒海蛇在岩石底 \n從此～守護廟宇\n數不清的～神佛仙界傳說　\n引領世人～來探索光臨\n\n如繁星撒落的 ～千島之國\n飛進這國度～ 心靈 ～瞬間超脫\n奢拉馬 西安 ~烏布~佳蘭 ~佳蘭\n熱鬧市集　叫賣聲 裡頭夾雜～意尼姆啦使尬哩（ 中譯：討價還價）\n\n雷貢舞～伴甘美朗　\n古老的～宮廷樂章\n炫麗金色　錦緞衣裳\n舞姿迴旋　叫人跌入　\n神秘旋渦 迷惘\n\n樂聲反覆　訴說傳奇\n古老的 宮廷樂章', '', 259, '', '默默+JC', '水漾貝啦', '', '', '', 0, 1, 0, '2013-02-06 15:11:53', '2015-03-12 13:59:16', '0000-00-00 00:00:00'),
