(60707, 72723, 3752, 10, '獨弦琴 ( 越南獨弦琴 )－蔡俞慶', '', '2011-11-10 00:00:00', 2000, 0, 1, 7, '＜獨弦琴＞　\r\n詞:蔡俞慶(ALEX)2011/10/18\r\n曲：朱康\r\n\r\n(主歌)\r\n瞻望彼方 浪花激昂\r\n時間染上夕陽\r\n朱紅的回憶 如葉飄盪\r\n\r\n逐波盪漾 送愁流江\r\n水面上的惆悵\r\n恰似有你的身影 迴盪\r\n\r\n(副歌)\r\n一根一弦琴 獨奏思鄉起\r\n手晃渡千里 一曲悲歡離\r\n深陷迷霧裡 還不能自己\r\n\r\n聞聲淚滿襟 漂泊久未停\r\n因緣難再續 寄情於飛絮\r\n撥弄弦外音 觸景 觴琴', '', 264, '', '朱康', '蔡俞慶', '', '', '', 0, 1, 0, '2013-02-06 15:38:46', '2015-03-12 13:59:16', '0000-00-00 00:00:00'),
