(60787, 170765, 0, 1, '末日（2013 demo)', '這首歌是在2011年10月寫的\r\n那時候2012的末日說 \r\n掀起了一段討論\r\n\r\n我記得在2011跨2012跨年夜\r\n我在某個party的陽台抽着煙\r\n我跟朋友看著窗外\r\n說著要是先在隕石墜落了\r\n要做什麼事\r\n\r\n我就說\r\n我想就把不想逃跑的朋友\r\n一起找來屋頂上喝著酒唱著歌抽着煙說著無聊的事\r\n反正今天過後就不用上班了\r\n也不會有什麼煩惱了\r\n這樣子迎接末日吧！！！', '2013-02-06 00:00:00', 2012, 0, 2, 7, '末日來臨之前\r\n是否和你想的一樣\r\n大樓全部崩塌\r\n伴隨逃竄的人兒啊\r\n我想靜靜坐在屋頂\r\n唱著喜歡的那首歌\r\n然後再喝一口再抽一口\r\n再見了我的朋友啊！\r\n\r\n也許不會太慌張\r\n也許緊張到講不出話\r\n電話打不出去啦\r\n電腦也可以丟掉啦\r\n我想靜靜坐在屋頂\r\n唱著喜歡的那首歌\r\n然後再喝一口再抽一口\r\n再見了我的朋友啊\r\n\r\n末日來了 末日來了\r\n終於肯來了\r\n再見了  再見了\r\n所有煩人的事都消散了\r\n\r\n末日來了  末日來了\r\n終於肯來了\r\n再見了 再見了\r\n所有煩人的事都消散了\r\n消散了消散了\r\n消散了消散了\r\n\r\n也許明天就要結束\r\n讓我們唱最後一首\r\n還有你們這些朋友\r\n末日來了也沒關係', '', 274, '', '', '', '', '', '', 0, 1, 1, '2013-02-06 18:51:48', '2013-10-07 17:23:59', '2013-05-20 04:44:31'),
